import React from "react";
import { SiHtml5 } from "react-icons/si";
import styled from "styled-components";
import palette from "../lib/styles/palette";

const skills = [
  {
    id: 1,
    icon: <SiHtml5 />,
    color: "#aaaaaa",
    category: "Front-end",
    level: 5,
  },
];

const SkillList = () => {
  return skills.map((skill) => <Skill key={skill.id} skill={skill}></Skill>);
};

const Skill = ({ skill }) => {
  console.log(skill);
  return (
    <SkillItem>
      <IconBox color={skill.color}>{skill.img}</IconBox>
    </SkillItem>
  );
};

const SkillItem = styled.div`
  color: ${palette.white};
`;

const IconBox = styled.div`
  font-size: 1rem;
  ${(props) => props.color || palette.white};
`;

export default SkillList;
